            is a person who is intent on disrupting constructive discussion by
            posting inflammatory remarks to halt the progress of a discussion 
            typically for the purpose of self-amusement or for the emotional
            high of winning an argument. This happens in online (and sometimes
            offline) spaces that lack established social norms or policy
            enforcement.
          </p>
          <p></p>
          <p></p>
          <p></p>
          <p></p>
          <p></p>
          <p></p>
          <p></p>
          <p>
            In an academic setting, the instructor sets the social norms of the
            classroom and maintains authority over moderating a discussion. It
            is not an instructor's job to be "thought police." Therefore, if a
            student has an opinion that is counter to the general opinions of
            the class, voicing those opinions are encouraged to provoke
            thoughtful discussion. However, disrespectful remarks meant to
            oppress another student will be considered trolling behavior and
            will not be allowed to continue without consequence.
          </p>
          <p></p>
          <p></p>
          <p></p>
          <p></p>
          <p></p>
          <p></p>
          <p></p>
          <p>
            Trolling is the antithetical to meaningful discussion and learning,
            so try to be mindful that your remarks (possibly being written under
            some emotional stress) don't accidentally veer off course and shut
            down a potentially helpful conversation.
          </p>
